import unittest
from binascii import unhexlify

from core.dkek import decrypt_dkek_wrapped_ec_key

dkek = unhexlify('2848cb6e994f5a00c365c3c255ed130512ce1eb06bf08d348eeb8b2f866e3e50')
wrapped_btc_key = unhexlify('')

class TestKeyWrapping(unittest.TestCase):
    
    def test_encryption_of_wrapped_btc_key(self):
        keyblob, eckey = decrypt_dkek_wrapped_ec_key(dkek, wrapped_btc_key)
        self.assertEqual(True, True)

if __name__ == '__main__':
    unittest.main()